      out.write("  //그리드 컬럼 변경 이벤트\r\n");
      out.write("  function gridListEventColValueChange(gridId, rowNum, colName, colValue){\r\n");
      out.write("    if(gridId == \"gridItemList\"){\r\n");
      out.write("       if(colName == \"QTYREQ\" || colName == \"BOXQTY\" || colName == \"REMQTY\"){ //수량변경시연결된 수량 변경\r\n");
      out.write("        var qtyreq = 0;\r\n");
      out.write("        var boxqty = 0;\r\n");
      out.write("        var remqty = 0;\r\n");
      out.write("        var pltqty = 0;\r\n");
      out.write("        var bxiqty = Number(gridList.getColData(gridId, rowNum, \"BXIQTY\"));\r\n");
      out.write("        var qtduom = Number(gridList.getColData(gridId, rowNum, \"QTDUOM\"));\r\n");
      out.write("        var pliqty = Number(gridList.getColData(gridId, rowNum, \"PLIQTY\"));\r\n");
