      out.write("        var totshp = 0;     //총출고수량\r\n");
      out.write("        var qtyreq2 = 0;    //납품요청수량(수정)\r\n");
      out.write("        \r\n");
      out.write("          if( colName == \"QTYREQ\" ) { //납품요청수량 변경시\r\n");
      out.write("          //납품요청수량과 원주문수량 비고\r\n");
      out.write("            if(Number(gridList.getColData(gridId, rowNum, \"QTYREQ\")) > Number(gridList.getColData(gridId, rowNum, \"QTYORG\"))){\r\n");
      out.write("            alert(\"* 납품요청수량이 원주문수량보다 큽니다. *\");\r\n");
      out.write("            gridList.setColValue(gridId, rowNum, \"QTYREQ\", 0);\r\n");
      out.write("          }\r\n");
      out.write("\r\n");
      out.write("            //박스 수량 등을 계산하여 각 컬럼에 세팅\r\n");
      out.write("            qtyreq = gridList.getColData(gridId, rowNum, \"QTYREQ\");\r\n");
      out.write("            boxqty = gridList.getColData(gridId, rowNum, \"BOXQTY\");\r\n");
      out.write("            remqty = gridList.getColData(gridId, rowNum, \"REMQTY\");\r\n");
      out.write("            \r\n");
      out.write("            boxqty = Math.floor((Number)(qtyreq)/(Number)(bxiqty), 0);\r\n");
      out.write("            remqty = (Number)(qtyreq)%(Number)(bxiqty);\r\n");
      out.write("            pltqty = Math.floor((Number)(qtyreq)/(Number)(pliqty), 0);\r\n");
      out.write("            qtyreq2 = (Number)(qtyreq) - (Number)(gridList.getColData(gridId, rowNum, \"QTSHPD\"));\r\n");
      out.write("            totshp = (Number)(gridList.getColData(gridId, rowNum, \"QTSHPD\")) + (Number)(qtyreq2);\r\n");
      out.write("            \r\n");
      out.write("            gridList.setColValue(gridId, rowNum, \"BOXQTY\", boxqty);\r\n");
      out.write("          gridList.setColValue(gridId, rowNum, \"REMQTY\", remqty);\r\n");
